 (let jj = 0; jj &lt; ncolumns; jj++) {\\n                    const column = keys[jj];\\n                    var ind = source.selected.indices[ii];\\n                    row.push(source.data[column][ind].toString());\\n                }\\n                lines.push(row.join(&#x27;, &#x27;));\\n            }\\n        }\\n        return lines.join(&#x27;\\\\n&#x27;).concat(&#x27;\\\\n&#x27;);\\n    };\\n\\n    // adapted from:\\n    // https://stackoverflow.com/questions/21012580/is-it-possible-to-write-\\n    // data-to-file-using-only-javascript\\n    var textFile = null;\\n    function makeTextFile(text) {\\n      var data = new Blob([text], {type: &#x27;text/plain&#x27;});\\n\\n      // If we are replacing a previously generated file we need to\\n      // manually revoke the object URL to avoid memory leaks.\\n      if (textFile !== null) {\\n        window.URL.revokeObjectURL(textFile);\\n      }\\n\\n      textFile = window.URL.createObjectURL(data);\\n\\n      return textFile;\\n    };\\n\\n    var link = document.createElement(&#x27;a&#x27;);\\n    // link.setAttribute(&#x27;download&#x27;, &#x27;exoplots_download.txt&#x27;);\\n    link.setAttribute(&#x27;target&#x27;, &#x27;_blank&#x27;);\\n    link.href = makeTextFile(makeCSV(sources, keys, header));\\n    document.body.appendChild(link);\\n\\n    // wait for the link to be added to the document\\n    window.requestAnimationFrame(function() {\\n      var event = new MouseEvent(&#x27;click&#x27;);\\n      link.dispatchEvent(event);\\n      document.body.removeChild(link);\\n    });\\n    "}}]]]},"styles":{"type":"map","entries":[["margin","auto 5px"]]},"label":"Download CSV of Selected Data"}},{"type":"object","name":"Div","id":"p1168","attributes":{"styles":{"type":"map","entries":[["margin","auto -3px auto 5px"]]},"text":"Transit:"}},{"type":"object","name":"ColorPicker","id":"p1169","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:color",[{"type":"object","name":"CustomJS","id":"p11
